import { post, get } from "./api.config";
const baseUrl = "/InvitationCode";
export function apiGetInvitationCode(data, need) {
  return get(baseUrl + "/GetInvitationCode", data, need);
}

export function apiGetUserInvitationNum(data, need) {
  return get(baseUrl + "/GetUserInvitationNum", data, need);
}

export function apiGetInvitationUrl(data, need) {
  return get(baseUrl + "/GetInvitationUrl", data, need);
}

export function apiGetInviter(data, need) {
  return get(baseUrl + "/GetInviter", data, need);
}

export function apiCheckInvitationCode(data, need) {
  return get(baseUrl + "/CheckInvitationCode", data, need);
}
